  ret.lookup_wasm2c_nonfunc_export = &lookup_wasm2c_nonfunc_export;
  ret.lookup_wasm2c_func_index = &lookup_wasm2c_func_index;
  ret.add_wasm2c_callback = &add_wasm2c_callback;
